import React from 'react'
import './Pages.css'
function Pages() {
    const [selected,setSelected] = useState(0)
    return (
        <div className='d-flex'>
            <div className='pageIndicator'><i class="fa fa-solid fa-chevron-left"></i></div>
            {
                Array(1, 2, "..", 9, 10)
                    .map(elem =>
                        <div className='pageIndicator'>{elem}</div>
                    )
            }
            <div className='pageIndicator'><i class="fa fa-solid fa-chevron-right"></i></div>
        </div>
    )
}

export default Pages
